(7702, 'Café Gringo', '', '200 g', 'Jacques Vabre', 'jacques-vabre', '', '', 'France', 'Depuis toujours Jacques Vabre est de café, ce produit de caractère, presque tant il est animé d\'arômes, d\'évocati&gt; Grâce à son talent et à son expertise Jacques Vabre crée des cafés aux goûts varis qui vont mettre vos sens en En mariant avec soin des grains de grande qualité, Jacques Vabre a conçu un café vraiment équilibré : un café bien afirmé intense sans être corsé, avec ce qutl d\'amertume mais sans âpreté. Un café fin tout en étant marqué. Conseils de préparation Lorsque le torréfacteur réalise un mélange, il assemble les meilleurs grains, déguste de nombreux cafés pour parvenir à force de paticncc et d\'imagination Qu mariage • le plus harmonieux possble. Pour retrouver tout cet arômeìt cette saveur, versez une cuilliére à café dans votre tasse, puis ajouter de l\'eau frémissante mais non bouillante.', '', '', '0', '', 'd', 'A compléter,Informations nutritionnelles complétées,Ingrédients complétés,Date limite à compléter,en:Packaging-code-to-be-completed,Caractéristiques à compléter,Catégories à compléter,Marques complétées,Emballage à compléter,Quantité complétée,Nom du produit complete,Photos à valider,Photos envoyées', '', 'http://fr.openfoodfacts.org/images/products/310/844/003/7802/front.3.400.jpg', 'http://fr.openfoodfacts.org/images/products/310/844/003/7802/front.3.200.jpg', '159', '', '15', '7', '', '8', '2', '', '', '', '', '', '', '9', '3', '1.18110236220472', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '', '16'),
